import ".././styles/NewsCard.css"
function NewsCard({image, title, date, description}) {
    return(
        <div id="news-card">
            <img id="news-picture" src={image} alt=""></img>
            <div>
                <div id="news-title">
                    {title}
                </div>
                <div id="news-date">
                    {date}
                </div>
                <div id="news-description">
                    {description}
                </div>
                <div id="news-link"></div>
            </div>
        </div>
    );
}

export default NewsCard;
